import React from "react";
import { Route } from "react-router-dom";
import HeaderHome from "../Components/Header/HeaderHome";
import FooterHome from "../Components/Footer/FooterHome";

/* PrivateRoute is for all Users & Visitor */ 
export var HomeRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        <React.Fragment>
          <HeaderHome />
          <Component {...props} />
          <FooterHome />
        </React.Fragment>
      }
    />
  );
};

/* PrivateRoute is for all Users & Visitor */ 
export var AdminRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        <React.Fragment>
          <div id="layout-wrapper">
            <Component {...props} />
          </div>
        </React.Fragment>
      }
    />
  );
};

/* PrivateRoute is for all Authentication [NOT LOGIN MEMBERS ONLY] */ 
export var AuthRoute = ({ component: Component, ...rest }) => {
  return (
    <Route
      {...rest}
      render={(props) =>
        <div className="auth-page">
          <div className="container">
            <div className="row justify-content-center align-items-center">
              <div className="col-lg-5 col-md-10">
                <div className="auth-page-box p-5 shadow-lg rounded-md">
                  <Component {...props} />
                </div>
              </div>
            </div>
          </div>
        </div>
      }
    />
  );
};
